import React, {Component, Fragment} from 'react';
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faCheckCircle, faEllipsisH} from "@fortawesome/free-solid-svg-icons";
import logo from "../../assets/pecb.png";

class RegisterSummary extends Component {
    render() {
        return (
            <Fragment>

                <div className={"row"}>


                    <div className={"col-4 order-2"}>

                        <img className="rounded me-2 mb-2" src={logo} alt="Placeholder"
                             width="140" height="140"/>

                    </div>

                    <div className={"col order-1"}>

                        <div className={"card"}>
                            <div className="card-header">
                                <div className="card-actions float-end">
                                    <div className="dropdown show">
                                        <a href="#" data-bs-toggle="dropdown" data-bs-display="static">
                                            <FontAwesomeIcon icon={faEllipsisH}/>
                                        </a>

                                        <div className="dropdown-menu dropdown-menu-end">
                                            <a className="dropdown-item" href="#">Action</a>
                                            <a className="dropdown-item" href="#">Another action</a>
                                            <a className="dropdown-item" href="#">Something else here</a>
                                        </div>
                                    </div>
                                </div>
                                <h5 className="card-title mb-0">Angelica Ramos</h5>
                            </div>
                        </div>

                    </div>


                </div>


            </Fragment>
        );
    }
}

export default RegisterSummary;
